import Grid from "@mui/material/Grid";
import { makeStyles } from "@mui/styles";

const useStyles = makeStyles({
  root: {
    bgcolor: "gray",
    my: 1,
    maxWidth: "90%",
    mx: "auto",
  },
});

const Home = (props) => {
  const classes = useStyles(props)
  return (
    <>
      <Grid
        container
        sx={{ bgcolor: "gray", my: 1, maxWidth: "90%", mx: "auto" }}
        justifyContent="space-between"
      >
        <Grid item xs={7} sx={{ bgcolor: "lightblue" }}>
          Main
        </Grid>
        <Grid item xs={4} sx={{ bgcolor: "yellow" }}>
          sidebar
        </Grid>
      </Grid>
    </>
  );
};

export default Home;
